const Box = (props) => {
  const isBtn = props.btn;
  return (
    <div className="box" >
      <img src={props.img} alt="image loading" />
      <div className="content">
        <h3>{props.place}</h3>
        <p>{props.data}</p>

        {isBtn ? <a href={p} class="btn">see more</a> : null}
      </div>
    </div>
  );
};

export default Box;
